var title_f4_37_4688="Model of inspiration";
var content_f4_37_4688=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F51871&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F51871&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 506px\">",
"   <div class=\"ttl\">",
"    Model of inspiration with respect to the volume/time cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 486px; height: 330px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In a patient breathing 20 breaths per minute with an I:E ratio of 1:2 and assuming no dwell time between breaths, the last 150 mL of inspired gas which fills the dead space requires about one-half the inspiratory time while the first part of the breath, representing about 0.5 seconds in this schematic, is the actual gas that reaches the alveoli and participates in gas exchange. Note that the very first gas in the airways is air that was exhaled from the alveoli. It is oxygen poor and CO",
"    <sub>",
"     2",
"    </sub>",
"    rich.",
"    <div class=\"footnotes\">",
"     V",
"     <sub>",
"      D",
"     </sub>",
"     : dead space; V",
"     <sub>",
"      A",
"     </sub>",
"     : volume of air that reaches the alveoli and participates in gas exchange; I:E: inspiratory:expiratory ratio.",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Tiep BL. Continuous flow oxygen therapy and basis for improving the efficiency of oxygen delivery. In: Portable Oxygen Therapy: Including Oxygen Conserving Methodology, Tiep BL (Ed), Futura Publishing, Mt Kisco, New York, 1991.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
